import React, { Component } from 'react';
import AppContext from './AppContext';

class AppProvider extends Component {
  render() {
    console.log(this.props.isMobile);
    return (
      <AppContext.Provider
        value={{
          isMobile: ''
        }}
      >
        {this.props.children}
      </AppContext.Provider>
    );
  }
}

export default AppProvider;
